Hi! 🥰I wanted to show you a quick demo of how I've been applying cream and liquid blushes...even ON TOP OF powder...to get a beautiful glowy natural look. You can layer powder blush on top if you'd like for extra dimension if you'd like. I've been doing this a TON lately! 
Let me know if you’d like more short little videos like this on the regular! I hope your week is fabulous so far! 💞xoxo
